import facebook from "./../../../assets/img/facebook";

const ProfileInfo = (props) => {
  
  if (!props.profile){
    return <Preloader />
  }

  let lookingForJob = () =>{
    if (props.profile.lookingForAJob) {
      return(
        <p>yes im looking for job </p>
      )      
  } else {
      return (
        <p>net</p>
      )    
  }
  }

  return (
    <div>
      <img
        className={s.space}
        src="https://avatanplus.com/files/resources/original/5cb1eb4d3d21516a16ff25c2.jpg"
      ></img>
      <div>
        <div className={s.user_item}>
            <img
              className={s.description_block}
              src={props.profile.photos.large}
            ></img>
            <div>
              <p>{props.profile.fullName}</p>
              <p>{props.profile.aboutMe}</p>
              <p>{lookingForJob()}</p>
            </div>
        </div>
        
        <div>          
          <h3>Social</h3>
          <div className={s.social}>
           <p><img src={pro} alt=""/>
             {props.profile.contacts.facebook}</p> 
           <p>{props.profile.contacts.vk}</p> 
           <p>{props.profile.contacts.twitter}</p>
          </div>
        </div>        
      </div>
    </div>
  );
};

export default ProfileInfo;
